import React, { useEffect, useState } from "react";

export default function AdminHome({ userData }) {
  const [data,setData]=useState([])
    useEffect(() => {
    fetch("http://localhost:5000/getAllUser", {
      method: "GET",
    })
      .then((res) => res.json())
      .then((data) => {
        console.log(data, "userData");
        setData(data.data);
      });
  }, []);

  return (
    <div>
      <h5>Welcome Admin</h5>
      <table style={{ width: 500 }}>
        <tr>
          <th>Name</th>
          <th>Email</th>
          <th>User Type</th>
          <th>Delete</th>
        </tr>

      </table>
    </div>
  );
}
